import { Component} from '@angular/core';

@Component({
  selector: 'app-admin-page',
  templateUrl: './admin-page.component.html',
  styleUrls: ['./admin-page.component.css']
})
export class AdminPageComponent {

  constructor(private router: Router, private route: ActivatedRoute) { }

  ngOnInit() {
    const routes: Routes = [
      { path: 'subcomponent1', component: Subcomponent1Component },
      { path: 'subcomponent2', component: Subcomponent2Component },
      // Otras rutas específicas de este componente...
      { path: '', redirectTo: 'subcomponent1', pathMatch: 'full' },
    ];

    this.router.resetConfig([...this.router.config, ...routes]);
    this.router.navigate([this.route.snapshot.url, 'subcomponent1']);
  }
}
